.q-notification
  box-shadow: $shadow-2
  border-radius: $generic-border-radius
  pointer-events: all
  display: inline-flex
  margin: 10px 10px 0
  transition: transform 1s, opacity 1s
  z-index: $z-notify
  flex-shrink: 0
  max-width: 95vw
  background: #323232
  color: #fff
  font-size: 14px
  &__icon
    font-size: 24px
    margin-right: 16px
