    font-size: 0.9em
    opacity: 0.7
  &__actions
    color: $primary
    color: var(--q-color-primary)
  &__badge
    animation: q-notif-badge .42s
    padding: 4px 8px
    position: absolute
    background: $negative
    box-shadow: $shadow-1
    background-color: $negative
    background-color: var(--q-color-negative)
    color: #fff
    border-radius: $generic-border-radius
    font-size: 12px
    line-height: 12px
    &--top-left,
    &--top-right
      top: -6px
    &--bottom-left,
    &--bottom-right
      bottom: -6px
    &--top-left,
    &--bottom-left
      left: -22px
    &--top-right,
    &--bottom-right
      right: -22px
  &__progress
    z-index: -1
    position: absolute
    height: 3px
    bottom: 0
    left: -10px
    right: -10px
    animation: q-notif-progress linear
    background: currentColor
    opacity: .3
    border-radius: $generic-border-radius $generic-border-radius 0 0
    transform-origin: 0 50%
    transform: scaleX(0)
  &--standard
    padding: 0 16px
    min-height: 48px
    .q-notification__actions
      padding: 6px 0 6px 8px
      margin-right: -8px
  &--multi-line
    min-height: 68px
    padding: 8px 16px
    .q-notification__badge
      &--top-left,
      &--top-right
