    z-index: ($z-notify - 1)
    margin-left: 0
    margin-right: 0
  &--top-leave-active,
  &--center-leave-active
    top: 0
  &--bottom-left-leave-active,
  &--bottom-leave-active,
  &--bottom-right-leave-active
